import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import GreetingElement from './myGreetingApp';
import AppColor from './AppBackgroundColor';
import reportWebVitals from './reportWebVitals';


ReactDOM.render(
    <React.StrictMode>
        <AppColor heading="First Component" label="Name: " color="green" id="input1" />
        <AppColor heading="Second Component" label="Name: " color="blue" id="input2" />
        <AppColor heading="Third Component" label="Name: " color="yellow" id="input3" />
    </React.StrictMode>,
    document.getElementById('root')
);


reportWebVitals();
